   "source": [
    "set.seed(154)\n",
    "# so you can reproduce the results\n",
    "w = rnorm(200); \n",
    "x = cumsum(w)\n",
    "# two commands in one line\n",
    "wd = w +.6; \n",
    "xd = cumsum(wd)\n",
    "plot.ts(xd, ylim=c(-5,55), main=\"random walk\", ylab='')\n",
    "lines(x, col=4); \n",
    "abline(h=0, col=4, lty=2); #h = y value for horizontal lines\n",
    "abline(a=0, b=.6, lty=2) #a, b intercept and slope"
   ]
